            username:'',
            email:'',
            feedback:'',
            category: 'Suggestion'
        }
    );

    const handleSubmit = async(e) =>{
        e.preventDefault();
        await submitFeedback(formData);
        alert('Feedback Submitted successfull!!');
        setFormData({
            username:'',
            email:'',
            feedback:'',
            category:'Suggestion'
        });

        const handleChange = (e) => {
            setFormData({...formData, [e.target.name]: e.target.value});
          };
        
    };

